import React from "react";

const Residence = () => {
  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <h1>About Us</h1>
      <p>Welcome to our website. We are dedicated to providing the best services.</p>
    </div>
  );
};

export default Residence;
